import { Outlet } from "react-router-dom";
import Sidebar from "../../components/SideBar";

export default function Dashboard(){
    return(
    <div style={{ display: "flex" }}>
      <Sidebar />
      <div style={{ width: "100%", padding: "20px" }}>
        <Outlet />
      </div>
    </div>
    )
}
